const jsonServer = require('json-server');
const server = jsonServer.create();
const router = jsonServer.router('db.json');
const middlewares = jsonServer.defaults();

// Set default middlewares (logger, static, cors and no-cache)
server.use(middlewares);

// Add custom routes before JSON Server router
server.get('/echo', (req, res) => {
  res.jsonp(req.query)
});

// To handle POST, PUT and PATCH you need to use a body-parser
// You can use the one used by JSON Server
server.use(jsonServer.bodyParser);


// login and authorization mechanism will not working with mock backend
server.get('/identity', (req, res) => {
    res.status(200).json({
      username: "user",
      authorities: ["ROLE_USER", "ROLE_MEMBER"]
    });
});

server.post('/auth', (req, res) => {
    if(req.body.password === '123') {
      return res.status(401).end();
    }
    res.status(200).json({
      token: "jwt-token"
    });
});

server.post('/profile/change-password', (req, res) => {
  if(req.body.currentPassword == '123') {
    res.status(400).end();
  } else {
    res.status(200).end();
  }
});

server.get('/profile/image/download', (req, res) => {
  res.status(200).json({
    content: "data:image/jpg;base64,"
  });
});

//
// server.get('/profile/image/download', (req, res) => {
//   res.status(404).end();
// });


// Use default router
server.use(router);
server.listen(3000, () => {
  console.log('JSON Server is running..')
});
